import React from "react";
import { Form, useParams, useOutletContext } from "react-router-dom";

export default function RequestPage() {
  const params = useParams();
  const userData = useOutletContext();
  const [lancerData, setLancerData] = React.useState([""]);

  const lancer = userData.freelancer?.map((item) => {
    if (item.UserName !== params.fUser) {
      setLancerData()
    } else return item;
  });

  return (
    <div className="requestPage">
      <h1>Task Description Page</h1>
      {lancer?.UserName}
      {lancer?.FirstName}
      {lancer?.LastName}
      {lancer?.MobileNo}

      <Form method="post">
        <input type="text" value={lancer?.UserName} name="lancerId" />
        <input type="text" value={userData.user.UserName} name="clientId" />
        <button type="submit">Request</button>
      </Form>
    </div>
  );
}
